import createReactComponent from '../createReactComponent';
var Clock11 = createReactComponent('Clock11', [['circle', {
  cx: '12',
  cy: '12',
  r: '10',
  key: '1mglay'
}], ['polyline', {
  points: '12 6 12 12 9.5 8',
  key: 'l5bg6f'
}]]);
export default Clock11;
